import { Swiper, SwiperSlide } from "swiper/react";
import { Pagination, Navigation } from "swiper";

import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import "./slider2.css";



const Slider2 = () =>{ 
return (
    <>
    <Swiper
        slidesPerView={3}
        spaceBetween={30}
        slidesPerGroup={3}
        loop={true}
        loopFillGroupWithBlank={true}
        // pagination={{
        // clickable: true,
        // }}
        // navigation={true}
        // modules={[Pagination, Navigation]}
        className="mySwiper"
    >
        <SwiperSlide>
            <button className="cardButton">
                <a href="google.com" target="_blank" className="cardLink">
                    <div className='cardImage'><img src='https://cdn-icons-png.flaticon.com/512/3534/3534033.png'/></div>
                    <h2>Universidad Distrital Francisco Jose de Caldas</h2>
                    {/* <div id='cardDescription'>Python basico</div> */}
                </a>
            </button>
        </SwiperSlide>
        <SwiperSlide>
            <button className="cardButton">
                <a href="#" target="_blank" className="cardLink">
                    <div className='cardImage'><img src="https://cdn-icons-png.flaticon.com/512/1838/1838102.png"/></div>
                    <h2>Frontend</h2>
                    {/* <div id='cardDescription'>Html</div> */}
                </a>
            </button>
        </SwiperSlide>
        <SwiperSlide>
            <button className="cardButton">
                <a href="#" target="_blank" className="cardLink">
                    <div className='cardImage'><img src="https://cdn-icons-png.flaticon.com/512/7862/7862765.png"/></div>
                    <h2>Backend</h2>
                    {/* <div id='cardDescription'>Html</div> */}
                </a>
            </button>
        </SwiperSlide>
    </Swiper>
    </>
)
}
export default Slider2
